import EmployeesListItem from "../employees-list-item/employess-list-item";
import './employees-list.css';

const EmployeesList = ({data}) => {
    return (
        <ul className="app-list list-group">
            <EmployeesListItem name="John Smith" salary={900} />
            <EmployeesListItem name="Gordon Black" salary={3000} />
            <EmployeesListItem name="Jack London" salary={5000} />
        </ul>
    )
}

export default EmployeesList;
